import axios from "axios";
import { apiUrl } from "../../src/constants/constants";
export const postApi = async (url, params) => {
  let obj = {
    ...params,
    role: "1",
  };
  try {
    let x = await axios.post(apiUrl + url, obj);
    return x;
  } catch (error) {
    return error.response;
  }
};

export const getApi = (url) => {
  // const config = {
  //   headers: {
  //     authorization: `Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..w6meXE_FYufJwvwEdp7nkHsnZKaSW3tMgMw4UHwKhXg`,
  //   },
  // };
  return axios.get(apiUrl + url).then((response) => {
    return response;
  });
};

export const getFaceBookData = (token) => {
  return axios
    .get(
      "https://graph.facebook.com/v2.5/me?fields=email,name,friends&access_token=" +
        token
    )
    .then((response) => {
      return response.data;
    });
};
